import { Link } from "react-router-dom";
import authContext from "../context/auth/authContext";
import React, { useContext } from "react";
import '../App.css';

export default function Navbar() {
  const { user } = useContext(authContext);
  const capitalize = (str) => str ? str.charAt(0).toUpperCase() + str.slice(1) : "";

  return (
    <nav
      className="navbar navbar-expand-lg navbar-light bg-white shadow-sm sticky-top"
      style={{ zIndex: 1050 }}
    >
      <div className="container-fluid px-4 px-lg-5 d-flex align-items-center justify-content-between">

        {/* Left links (only for normal users) */}
        {!user?.admin && (
          <ul className="navbar-nav flex-row gap-3 d-none d-lg-flex">
            <li className="nav-item"><Link to="/women" className="nav-link">WOMEN</Link></li>
            <li className="nav-item"><Link to="/men" className="nav-link">MEN</Link></li>
            <li className="nav-item"><Link to="/about" className="nav-link">ABOUT</Link></li>
            <li className="nav-item"><Link to="/contact" className="nav-link">CONTACT</Link></li>
          </ul>
        )}

        {/* Center brand */}
        <div className="navbar-center flex-grow-1 d-flex justify-content-center">
          <Link 
            to="/" 
            className="navbar-brand fw-light"
            style={{ letterSpacing: '4px', fontWeight: 300 }}
          >
            {user?.admin ? `${capitalize(user?.name)} Dashboard` : "MINIMAL"}
          </Link>
        </div>

        {/* Right links */}
        <ul className="navbar-nav flex-row gap-3 d-none d-lg-flex">
          {!user?.admin && (
            <li className="nav-item"><Link to="/cart" className="nav-link">BAG (0)</Link></li>
          )}
          <li className="nav-item"><Link to="/signup" className="nav-link">Register</Link></li>
          <li className="nav-item"><Link to="/login" className="nav-link">Login</Link></li>
        </ul>

        {/* Mobile toggle (only for normal users) */}
        {!user?.admin && (
          <button
            className="navbar-toggler border-0 d-lg-none ms-auto"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
        )}

        {/* Collapsed menu for mobile */}
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav text-center py-3 gap-3">
            <li><Link to="/products?category=women" className="nav-link">WOMEN</Link></li>
            <li><Link to="/products?category=men" className="nav-link">MEN</Link></li>
            <li><Link to="/about" className="nav-link">ABOUT</Link></li>
            <li><Link to="/contact" className="nav-link">CONTACT</Link></li>
            <li><Link to="/cart" className="nav-link">BAG (0)</Link></li>
            <li><Link to="/signup" className="nav-link">Register</Link></li>
            <li><Link to="/login" className="nav-link">Login</Link></li>
          </ul>
        </div>

      </div>
    </nav>
  );
}
